import React from 'react';

function Navbar() {
    return (
        <nav className="navbar sticky-top navbar-dark bg-primary nav-pills flex-column flex-sm-row">
            <ul className="navbar-nav">
                <li className="nav-item"><h1>Loop Fruits</h1></li>
                <li className="nav-item">Right or Wrong</li>
                <li className="nav-item right">Score Stuff</li>
            </ul>
        </nav>
    );
};

export default Navbar;
